  // **********************************************
  // Command Activation Handler
  // **********************************************
  public void CmdClickCB(int CmdIdx)
  {
    fine:
    {
      if (CmdIdx==MyGlb.CMD_NUOVO11+BaseCmdLinIdx)
      {
        Inserisci();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_ELIMIDAMANDA+BaseCmdLinIdx)
      {
        EliminaDaMandato();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_SALVA51+BaseCmdLinIdx)
      {
        Salva();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_FUNZIOAGG111+BaseCmdLinIdx)
      {
        MainFrm.CmdObj.ShowPopup(MyGlb.CMDS_FUNZAGGILIQU+BaseCmdSetIdx, "M" + (MyGlb.CMD_FUNZIOAGG111+BaseCmdLinIdx), FormIdx, 1);
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_DATIBENEFICI+BaseCmdLinIdx)
      {
        ApriDatiBeneficiari();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_SOGGETEQUIE5+BaseCmdLinIdx)
      {
        ApriSoggettiEQuietanze();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_ANNUMODIECON+BaseCmdLinIdx)
      {
        AnnullaModificheEconomica();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_SALVA23+BaseCmdLinIdx)
      {
        Salva();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_ELIMINA1+BaseCmdLinIdx)
      {
        EliminaEconomica();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_ANNULMODIFSI+BaseCmdLinIdx)
      {
        AnnullaModificheSchedeInventario();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_SALVASI+BaseCmdLinIdx)
      {
        Salva();
        break fine;
      }
      if (CmdIdx==MyGlb.CMD_ELIMINASI+BaseCmdLinIdx)
      {
        EliminaSchedeInventario();
        break fine;
      }
    }
  }
  
  
