  // **********************************************
  // Update Controls against IMDB variations
  // **********************************************
  public void UpdateControls()
  {
    try
    {    
      if (IMDB.TblModified(IMDBDef5.TBL_IMPECO, MyGlb.GlbRefModIdx) || JustLoaded)
      {
        LIQUIDAZIONE_IMPECO12();
      }
      if (IMDB.TblModified(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ, MyGlb.GlbRefModIdx) || JustLoaded)
      {
        LIQUIDAZIONE_IMDSCHINVLI1();
      }
      if (IMDB.TblModified(IMDBDef5.TBL_DIVERSBENEF2, MyGlb.GlbRefModIdx) || JustLoaded)
      {
        LIQUIDAZIONE_DIVERSBENEF5();
      }
      if (IMDB.TblModified(IMDBDef5.TBL_BENEFICIAR27, MyGlb.GlbRefModIdx) || JustLoaded)
      {
        LIQUIDAZIONE_BENEFICIAR13();
      }
      if (IMDB.TblModified(IMDBDef5.TBL_PARAMETRI136, MyGlb.GlbRefModIdx) || JustLoaded)
      {
        LIQUIDAZIONE_PARAMETRI236();
      }
      PAN_LIQUIDAZIONE.UpdatePanel(MainFrm);
      PAN_ECONOMICA.UpdatePanel(MainFrm);
      PAN_SCHEDEINVENT.UpdatePanel(MainFrm);
      PAN_DIVERSBENEFI.UpdatePanel(MainFrm);
      PAN_BENEFICIARIO.UpdatePanel(MainFrm);
      PAN_INEMISSIONE.UpdatePanel(MainFrm);
      //
    }
    catch(Exception e)
    {
      e.printStackTrace(System.out);
    }
    JustLoaded = false;
    DOSetCaption();
    super.UpdateControls();
  }
  
  
