  // **********************************************************************
  // Unload Event
  // Evento notificato dal form prima della chiusura dello
  // stesso
  // Cancel: Se impostato a True la chiusura del form viene annullata. - Input/Output
  // Confirm: Rappresenta la scelta dell'utente per la chiusura dei form modali. True se l'utente ha confermato la scelta effettuata, False altrimenti. - Input
  // **********************************************************************
  public void IntFormUnload (IDVariant Cancel, IDVariant Confirm)
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;

    try
    {
      TransCount = 0;
      // 
      // Unload Event Body
      // Procedure Body
      // 
      if (ECONOMMODIFI.booleanValue())
      {
        IDVariant v_AVVISO = new IDVariant(0,IDVariant.STRING);
        v_AVVISO = (new IDVariant("La videata contiene dati non salvati. Prima di chiudere, salvare i dati o annullare le modifiche."));
        MainFrm.set_AlertMessage(v_AVVISO); 
        Cancel.set((new IDVariant(-1)));
        return;
      }
      if (SCHEINVEMODI.booleanValue())
      {
        IDVariant v_AVVISO = new IDVariant(0,IDVariant.STRING);
        v_AVVISO = (new IDVariant("La videata Schede Inventario contiene dati non salvati. Prima di chiudere, salvare i dati o annullare le modifiche."));
        MainFrm.set_AlertMessage(v_AVVISO); 
        Cancel.set((new IDVariant(-1)));
        return;
      }
      AzzeraParametri((new IDVariant(0)));
      PAN_DIVERSBENEFI.PanelCommand(Glb.PCM_UPDATE);
      PAN_BENEFICIARIO.PanelCommand(Glb.PCM_UPDATE);
      UNLOADEVENT_DIVBENDELROW();
      UNLOADEVENT_BENEDELEROWS();
      UNLOADEVENT_PARAMEDELETE();
      UNLOADEVENT_IMPECODELETE();
      UNLOADEVENT_IMDSCHINLIDE();
      if ((MainFrm.GetForm(MyGlb.FRM_SCELTALIQUID, 0, false)!=null))
      {
        ((SceltaLiquidazioni)MainFrm.GetForm(MyGlb.FRM_SCELTALIQUID,0)).PAN_LIQUIDAZIONI.PanelCommand(Glb.PCM_REQUERY);
      }
      if ((MainFrm.GetForm(MyGlb.FRM_MANDATI, 0, false)!=null))
      {
        ((Mandati)MainFrm.GetForm(MyGlb.FRM_MANDATI,0)).PAN_MANDATI.PanelCommand(Glb.PCM_REQUERY);
        ((Mandati)MainFrm.GetForm(MyGlb.FRM_MANDATI,0)).PAN_LIQUIDAZIONI.PanelCommand(Glb.PCM_REQUERY);
      }
      IMDB.set_Value(IMDBDef6.TBL_PARAMEESPLO1, IMDBDef6.FLD_PARAMEESPLO1_PARAAGGDAFUO, 0, (new IDVariant("SI")));
      IMDB.set_Value(IMDBDef6.TBL_PARAMEESPLO2, IMDBDef6.FLD_PARAMEESPLO2_PARAAGGDAFUO, 0, (new IDVariant("SI")));
      IMDB.set_Value(IMDBDef6.TBL_PARAMEESPLO4, IMDBDef6.FLD_PARAMEESPLO4_PARAAGGDAFUO, 0, (new IDVariant("SI")));
      IMDB.set_Value(IMDBDef6.TBL_PARAMEESPLO5, IMDBDef6.FLD_PARAMEESPLO5_PARAAGGDAFUO, 0, (new IDVariant("SI")));
      IMDB.set_Value(IMDBDef6.TBL_PARAMEESPLO6, IMDBDef6.FLD_PARAMEESPLO6_PARAAGGDAFUO, 0, (new IDVariant("SI")));
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "UnloadEvent", _e);
    }
  }

