  // **********************************************************************
  // Schede Inventario On Updating Row
  // Evento notificato dal pannello quando un utente modifica
  // i dati presenti nel pannello
  // Column - Input
  // Field Modified - Input
  // Field Was Modified - Input
  // Row Was Modified - Input
  // Inserting - Input
  // Cancel - Input/Output
  // **********************************************************************
  private void PAN_SCHEDEINVENT_OnUpdatingRow(IDVariant Column, IDVariant FieldModified, IDVariant FieldWasModified, IDVariant RowWasModified, IDVariant Inserting, IDVariant Cancel)
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;

    try
    {
      TransCount = 0;
      // 
      // Schede Inventario On Updating Row Body
      // Corpo Procedura
      // 
      if (!(SCHEINVEMODI.booleanValue()))
      {
        SCHEINVEMODI = (new IDVariant(-1));
        ModificaCaptionSchedeInventario(SCHEINVEMODI);
      }
      if (Inserting.booleanValue())
      {
        if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_SCHINVLIQSTA, 0)))
        {
          IMDB.set_Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_SCHINVLIQSTA, 0, (new IDVariant("I")));
        }
      }
      else
      {
        if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_SCHINVLIQSTA, 0)))
        {
          IMDB.set_Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_SCHINVLIQSTA, 0, (new IDVariant("U")));
        }
      }
      if (Column.equals((new IDVariant(PFL_SCHEDEINVENT_IMPORTO)), true) && FieldWasModified.booleanValue())
      {
        if (IMDB.Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_IMPORTO, 0).equals((new IDVariant(0)), true))
        {
          IDVariant v_VMSG = new IDVariant(0,IDVariant.STRING);
          v_VMSG = (new IDVariant("L'importo da imputare alla scheda inventario non pu essere 0"));
          MainFrm.set_AlertMessage(v_VMSG); 
          IMDB.set_Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_IMPORTO, 0, (new IDVariant()));
        }
      }
      // 
      // Controllo esistenza scheda inventario
      // 
      if (!(IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_PROGR_SCHEDA_CIWEB, 0))) && IMDB.Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_SCHINVLIQSTA, 0).equals((new IDVariant("I")), true))
      {
        if (IDL.NullValue((new IDVariant(PAN_SCHEDEINVENT.FieldText(PFL_SCHEDEINVENT_DESCRIZIBENE))),(new IDVariant(""))).equals((new IDVariant("")), true))
        {
          IDVariant v_VMSG1 = new IDVariant(0,IDVariant.STRING);
          v_VMSG1 = (new IDVariant("Scheda inventario non esistente"));
          MainFrm.set_AlertMessage(v_VMSG1); 
          IMDB.set_Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_PROGR_SCHEDA_CIWEB, 0, (new IDVariant()));
        }
        else
        {
          // 
          // Se importo nullo si compila con il residuo della liquidazione
          // 
          if (Inserting.booleanValue())
          {
            if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_IMPORTO, 0)) || IMDB.Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_IMPORTO, 0).equals((new IDVariant(0)), true))
            {
              IDVariant v_VTOTLIQ = new IDVariant(0,IDVariant.DECIMAL);
              IDVariant v_VTOTINV = new IDVariant(0,IDVariant.DECIMAL);
              v_VTOTLIQ = IDL.NullValue(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0),(new IDVariant(0)));
              v_VTOTINV = IDL.NullValue(PAN_SCHEDEINVENT.GetFieldSum(PFL_SCHEDEINVENT_IMPORTO),(new IDVariant(0)));
              if (v_VTOTLIQ.compareTo(v_VTOTINV, true)>0)
              {
                IMDB.set_Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_IMPORTO, 0, IDL.Sub(v_VTOTLIQ, v_VTOTINV));
              }
            }
          }
        }
      }
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "SchedeInventarioOnUpdatingRow", _e);
    }
  }

