  // **********************************************************************
  // Imdb Escludi Mandati Provvisori: Insert into... select
  // Perch stai inserendo questi dati?
  // **********************************************************************
  private void SCELMANDPROV_IMESMAPRINIS() throws SQLException
  {
    StringBuffer SQL = new StringBuffer();
    IDCachedRowSet RS = new IDCachedRowSet();

    SQL = new StringBuffer();
    SQL.append("select ");
    SQL.append("  " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ESERCIZIO_PROVV, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + " as LIQESEPRLILI, ");
    SQL.append("  " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_PROGRESSIVO_PROVV, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + " as LIQPROPRLILI, ");
    SQL.append("  " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_PROGRESSIVO_PROV_DETT, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + " as LIPRPRDELILI ");
    SQL.append("from ");
    SQL.append("  DUAL A ");
    RS = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
    if (!RS.EOF()) RS.MoveNext();
    while (!RS.EOF())
    {
      IMDB.TblAddNew(IMDBDef5.TBL_IMDESCMANPRO, 0);
      IMDB.set_Value(IMDBDef5.TBL_IMDESCMANPRO,IMDBDef5.FLD_IMDESCMANPRO_NOMEOGGEESER,0,RS.Get(1));
      IMDB.set_Value(IMDBDef5.TBL_IMDESCMANPRO,IMDBDef5.FLD_IMDESCMANPRO_NOMEOGGEPROG,0,new IDVariant(RS.Get(2),IDVariant.INTEGER));
      IMDB.set_Value(IMDBDef5.TBL_IMDESCMANPRO,IMDBDef5.FLD_IMDESCMANPRO_NOMOGGPRODET,0,RS.Get(3));
      RS.MoveNext();
    }
  }

