          IMDB.set_Value(IMDBDef1.TBL_PARAMETRI502, IMDBDef1.FLD_PARAMETRI502_ROWNAMDATREG, 0, IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_D_DATA_REG, 0));
