          IMDB.set_Value(IMDBDef1.TBL_PARAMETRI502, IMDBDef1.FLD_PARAMETRI502_ROWNAMCODLI5, 0, new IDVariant(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_COD_LIVELLO_5, 0),IDVariant.INTEGER));
          IMDB.set_Value(IMDBDef1.TBL_PARAMETRI502, IMDBDef1.FLD_PARAMETRI502_ROWNAMEES, 0, (new IDVariant("S")));
          MainFrm.Show(MyGlb.FRM_SCEFATCONRIC, (new IDVariant(-1)).intValue(), this); 
