  public int SettaFinanziamento (IDVariant AnnoImp, IDVariant NumeroImp, IDVariant AnnoSubImp, IDVariant NumeroSubImp)
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;
    IDVariant v_CODICEFIN = new IDVariant(0,IDVariant.INTEGER);
    IDVariant v_NUMREC = new IDVariant(0,IDVariant.INTEGER);

    try
    {
      TransCount = 0;
      // 
      // Setta Finanziamento Body
      // Procedure Body
      // 
      if (!(IDL.IsNull(AnnoSubImp)) && !(IDL.IsNull(NumeroSubImp)))
      {
        SQL = new StringBuffer();
        SQL.append("select ");
        SQL.append("  MIN(A.FINANZIAMENTO) as MINSUBFINFIN, ");
        SQL.append("  COUNT(*) as COUNT1 ");
        SQL.append("from ");
        SQL.append("  SUBIMP_FIN A ");
        SQL.append("where (A.ANNO_SUBIMP = " + IDL.CSql(AnnoSubImp, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        SQL.append("and   (A.NUMERO_SUBIMP = " + IDL.CSql(NumeroSubImp, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
        if (!QV.EOF()) QV.MoveNext();
        if (!QV.EOF())
        {
          v_CODICEFIN = QV.Get("MINSUBFINFIN", IDVariant.INTEGER) ;
          v_NUMREC = QV.Get("COUNT1", IDVariant.INTEGER) ;
        }
        QV.Close();
        if (v_NUMREC.equals((new IDVariant(1)), true))
        {
          IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FINANZIAMENTO, 0, new IDVariant(v_CODICEFIN));
        }
        else
        {
          IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FINANZIAMENTO, 0, (new IDVariant()));
        }
      }
      else
      {
        SQL = new StringBuffer();
        SQL.append("select ");
        SQL.append("  MIN(A.FINANZIAMENTO) as MINIMPFINFIN, ");
        SQL.append("  COUNT(*) as COUNT1 ");
        SQL.append("from ");
        SQL.append("  IMP_FIN A ");
        SQL.append("where (A.ANNO_IMP = " + IDL.CSql(AnnoImp, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        SQL.append("and   (A.NUMERO_IMP = " + IDL.CSql(NumeroImp, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
        if (!QV.EOF()) QV.MoveNext();
        if (!QV.EOF())
        {
          v_CODICEFIN = QV.Get("MINIMPFINFIN", IDVariant.INTEGER) ;
          v_NUMREC = QV.Get("COUNT1", IDVariant.INTEGER) ;
        }
        QV.Close();
        if (v_NUMREC.equals((new IDVariant(1)), true))
        {
          IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FINANZIAMENTO, 0, new IDVariant(v_CODICEFIN));
        }
        else
        {
          IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FINANZIAMENTO, 0, (new IDVariant()));
        }
      }
      return 0;
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "SettaFinanziamento", _e);
      return -1;
    }
  }

  // **********************************************************************
  // Setta Valori Da Documento
  // Anno Prog:  - Input
  // Numero Prog:  - Input
  // Anno Doc:  - Input
  // Numero Doc:  - Input
  // Beneficiario:  - Input
  // **********************************************************************
  public int SettaValoriDaDocumento (IDVariant AnnoProg, IDVariant NumeroProg, IDVariant AnnoDoc, IDVariant NumeroDoc, IDVariant Beneficiario)
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;
    IDVariant v_ANNOPROG = new IDVariant(0,IDVariant.INTEGER);
    IDVariant v_NUMEROPROG = new IDVariant(0,IDVariant.INTEGER);
    IDVariant v_NUMQUIETANZA = new IDVariant(0,IDVariant.INTEGER);
    IDVariant v_IMPORTO = new IDVariant(0,IDVariant.DECIMAL);

    try
    {
      TransCount = 0;
      // 
      // Setta Valori Da Documento Body
      // Procedure Body
      // 
      IDVariant v_VFATCIG = null;
      v_VFATCIG = (new IDVariant());
      IDVariant v_VFATCUP = null;
      v_VFATCUP = (new IDVariant());
      IDVariant v_TRATTIVA = new IDVariant(0,IDVariant.STRING);
      IDVariant v_VFATCODICDOC = new IDVariant(0,IDVariant.INTEGER);
      SQL = new StringBuffer();
      SQL.append("select ");
      SQL.append("  A.ANNO_PROG as FATANNOPROG, ");
      SQL.append("  A.NUMERO_PROG as FATNUMERPROG, ");
      SQL.append("  A.NUM_QUIETANZA as FATNUMQUIETA, ");
      SQL.append("  NVL(A.IMPORTO, 0) + NVL(A.VARIAZIONI, 0) - NVL(A.IMPUTATO, 0) as NVFI0NVFV0NV, ");
      SQL.append("  A.CIG as FATCIG, ");
      SQL.append("  A.CUP as FATCUP, ");
      SQL.append("  A.TRATTAMENTO_IVA as FATTRATTAIVA, ");
      SQL.append("  A.CODICE_DOC as FATCODICEDOC ");
      SQL.append("from ");
      SQL.append("  FAT A ");
      SQL.append("where (A.ANNO_DOC = " + IDL.CSql(AnnoDoc, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
      SQL.append("and   (A.NUMERO_DOC = " + IDL.CSql(NumeroDoc, IDL.FMT_CHAR, MainFrm.Cf4armDBObject.DBO()) + ") ");
      SQL.append("and   (A.ANNO_PROG = NVL(" + IDL.CSql(AnnoProg, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ", A.ANNO_PROG)) ");
      SQL.append("and   (A.NUMERO_PROG = NVL(" + IDL.CSql(NumeroProg, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ", A.NUMERO_PROG)) ");
      SQL.append("and   (A.CODICE = " + IDL.CSql(Beneficiario, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
      QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
      if (!QV.EOF()) QV.MoveNext();
      if (!QV.EOF())
      {
        v_ANNOPROG = QV.Get("FATANNOPROG", IDVariant.INTEGER) ;
        v_NUMEROPROG = QV.Get("FATNUMERPROG", IDVariant.INTEGER) ;
        v_NUMQUIETANZA = QV.Get("FATNUMQUIETA", IDVariant.INTEGER) ;
        v_IMPORTO = QV.Get("NVFI0NVFV0NV", IDVariant.DECIMAL) ;
        v_VFATCIG = QV.Get("FATCIG", IDVariant.STRING) ;
        v_VFATCUP = QV.Get("FATCUP", IDVariant.STRING) ;
        v_TRATTIVA = QV.Get("FATTRATTAIVA", IDVariant.STRING) ;
        v_VFATCODICDOC = QV.Get("FATCODICEDOC", IDVariant.INTEGER) ;
      }
      QV.Close();
      IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FAT_ANNO_PROG, 0, new IDVariant(v_ANNOPROG));
      IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FAT_NUMERO_PROG, 0, new IDVariant(v_NUMEROPROG));
      IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0, new IDVariant(v_IMPORTO));
      IMDB.set_Value(IMDBDef5.TBL_PARAMETRIOL7, IMDBDef5.FLD_PARAMETRIOL7_PARAMIMPOOLD, 0, IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0));
      // 
      // per correzione bug http://svi-redmine.finmatica.local
      // issues/12810
      // 
      if (ECONOMVISIBI.booleanValue() && !(IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0))))
      {
        if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_IMPORTO, 0)))
        {
          IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_IMPORTO, 0, IDL.Sub(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0), IDL.NullValue(PAN_ECONOMICA.GetFieldSum(PFL_ECONOMICA_IMPORTO2),(new IDVariant(0)))));
          PAN_ECONOMICA.UpdatePanel(MainFrm);
        }
      }
      // 
      // Per le schede inventario possibilit di non inserire
      // alcuna riga
      // 
      // if (SCHEINVEVISI.booleanValue() && !(IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0))))
      // {
        // if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_IMPORTO, 0)))
        // {
          // IMDB.set_Value(IMDBDef14.PQRY_IMDSCHINVLI1, IMDBDef14.PQSL_IMDSCHINVLI1_IMPORTO, 0, IDL.Sub(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0), IDL.NullValue(PAN_SCHEDEINVENT.GetFieldSum(PFL_SCHEDEINVENT_IMPORTO),(new IDVariant(0)))));
          // PAN_SCHEDEINVENT.UpdatePanel(MainFrm);
        // }
      // }
      // 
      // -------------
      // 
      if (((v_TRATTIVA.equals((new IDVariant("SP")), true)) || (v_TRATTIVA.equals((new IDVariant("RC")), true))) && v_VFATCODICDOC.compareTo((new IDVariant(4)), true)!=0)
      {
        IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO_IVA, 0, MainFrm.Calcolaivaliq(v_ANNOPROG, v_NUMEROPROG));
      }
      if (!(IDL.IsNull(v_VFATCIG)))
      {
        IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_CIG, 0, new IDVariant(v_VFATCIG));
      }
      if (!(IDL.IsNull(v_VFATCUP)))
      {
        IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_CUP, 0, new IDVariant(v_VFATCUP));
      }
      if (MainFrm.ControlloScadenzaQuietanza(v_NUMQUIETANZA, new IDVariant(Beneficiario,IDVariant.FLOAT), IDL.Today()))
      {
        IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUM_QUIETANZA, 0, new IDVariant(v_NUMQUIETANZA));
      }
      else
      {
        IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUM_QUIETANZA, 0, MainFrm.SettaQuietanzaBeneficiario(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_BENEFICIARIO, 0), IDL.NullValue(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_D_DATA_REG, 0),IDL.Today())));
      }
      if (MainFrm.SPESE_DA_SOGGETTO.equals((new IDVariant("SI")), true))
      {
        SettaSpeseDaQuietanza(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUM_QUIETANZA, 0), IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_BENEFICIARIO, 0));
      }
      IMDB.set_Value(IMDBDef5.TBL_PARAMETRIOL7, IMDBDef5.FLD_PARAMETRIOL7_PARAMQUIEOLD, 0, IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUM_QUIETANZA, 0));
      return 0;
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "SettaValoriDaDocumento", _e);
      return -1;
    }
  }

