      // Proponi Bollo Nuovo Body
      // Procedure Body
      // 
      SQL = new StringBuffer();
      SQL.append("select ");
      SQL.append("  MIN(A.CODICE) as MINT60CODICE ");
      SQL.append("from ");
      SQL.append("  T60 A ");
      SQL.append("where (A.TIPO = CASE WHEN (" + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_DOC, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + " IS NULL) THEN 'L' ELSE 'F' END) ");
