  // **********************************************************************
  public int PropostaSuNuovaRiga ()
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;
    IDVariant v_CENTRO1 = new IDVariant(0,IDVariant.STRING);
    IDVariant v_FATTORE = new IDVariant(0,IDVariant.STRING);
    IDVariant v_CENTRO = new IDVariant(0,IDVariant.STRING);
    IDVariant v_FATTORVALIDO = new IDVariant(0,IDVariant.STRING);
    IDVariant v_COMPDAL = new IDVariant(0,IDVariant.DATETIME);
    IDVariant v_COMPAL = new IDVariant(0,IDVariant.DATETIME);

    try
    {
      TransCount = 0;
      // 
      // Proposta Su Nuova Riga Body
      // Procedure Body
      // 
      IDVariant v_RILEVANTEECO = null;
      v_RILEVANTEECO = (new IDVariant());
      v_COMPDAL = (new IDVariant());
      v_COMPAL = (new IDVariant());
      IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_ESERCIZIO, 0, IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_LIQ, 0));
      IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_ANNO_LIQ, 0, IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_LIQ, 0));
      IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_NUMERO_LIQ, 0, IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_LIQ, 0));
      if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_SUBIMP, 0)) || IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_SUBIMP, 0)))
      {
        SQL = new StringBuffer();
        SQL.append("select ");
        SQL.append("  A.FATTORE as IMPFATTORE, ");
        SQL.append("  A.CENTRO as IMPCENTRO, ");
        SQL.append("  A.COMPETENZA_DAL as IMPCOMPETDAL, ");
        SQL.append("  A.COMPETENZA_AL as IMPCOMPETEAL, ");
        SQL.append("  A.RILEVANTE_ECO as IMPRILEVAECO ");
        SQL.append("from ");
        SQL.append("  IMP A ");
        SQL.append("where (A.ANNO_IMP = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_IMP, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        SQL.append("and   (A.NUMERO_IMP = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_IMP, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
        if (!QV.EOF()) QV.MoveNext();
        if (!QV.EOF())
        {
          v_FATTORE = QV.Get("IMPFATTORE", IDVariant.STRING) ;
          v_CENTRO1 = QV.Get("IMPCENTRO", IDVariant.STRING) ;
          v_COMPDAL = QV.Get("IMPCOMPETDAL", IDVariant.DATETIME) ;
          v_COMPAL = QV.Get("IMPCOMPETEAL", IDVariant.DATETIME) ;
          v_RILEVANTEECO = QV.Get("IMPRILEVAECO", IDVariant.STRING) ;
        }
        QV.Close();
      }
      else
      {
        SQL = new StringBuffer();
        SQL.append("select ");
        SQL.append("  A.FATTORE as SUBIMPFATTOR, ");
        SQL.append("  A.CENTRO as SUBIMPCENTRO, ");
        SQL.append("  A.COMPETENZA_DAL as SUBIMCOMPDAL, ");
        SQL.append("  A.COMPETENZA_AL as SUBIMCOMPEAL, ");
        SQL.append("  A.RILEVANTE_ECO as SUBIMRILEECO ");
        SQL.append("from ");
        SQL.append("  SUBIMP A ");
        SQL.append("where (A.ANNO_SUBIMP = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_SUBIMP, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        SQL.append("and   (A.NUMERO_SUBIMP = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_SUBIMP, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
        if (!QV.EOF()) QV.MoveNext();
        if (!QV.EOF())
        {
          v_FATTORE = QV.Get("SUBIMPFATTOR", IDVariant.STRING) ;
          v_CENTRO1 = QV.Get("SUBIMPCENTRO", IDVariant.STRING) ;
          v_COMPDAL = QV.Get("SUBIMCOMPDAL", IDVariant.DATETIME) ;
          v_COMPAL = QV.Get("SUBIMCOMPEAL", IDVariant.DATETIME) ;
          v_RILEVANTEECO = QV.Get("SUBIMRILEECO", IDVariant.STRING) ;
        }
        QV.Close();
      }
      v_FATTORVALIDO = (new IDVariant());
      v_CENTRO = (new IDVariant());
      SQL = new StringBuffer();
      SQL.append("select ");
      SQL.append("  A.FATTORE as FATTORFATTOR ");
      SQL.append("from ");
      SQL.append("  FATTORI A ");
      SQL.append("where (A.FATTORE = " + IDL.CSql(v_FATTORE, IDL.FMT_CHAR, MainFrm.Cf4armDBObject.DBO()) + ") ");
      SQL.append("and   ((A.DATA_VALIDITA IS NULL) OR A.DATA_VALIDITA >= " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_D_DATA_REG, 0), IDL.FMT_DAT3, MainFrm.Cf4armDBObject.DBO()) + ") ");
      QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
      if (!QV.EOF()) QV.MoveNext();
      if (!QV.EOF())
      {
        v_FATTORVALIDO = QV.Get("FATTORFATTOR", IDVariant.STRING) ;
      }
      QV.Close();
      SQL = new StringBuffer();
      SQL.append("select ");
      SQL.append("  A.CENTRO as CENTRICENTRO ");
      SQL.append("from ");
      SQL.append("  CENTRI A ");
      SQL.append("where (A.CENTRO = " + IDL.CSql(v_CENTRO1, IDL.FMT_CHAR, MainFrm.Cf4armDBObject.DBO()) + ") ");
      SQL.append("and   ((A.DATA_VALIDITA IS NULL) OR A.DATA_VALIDITA >= " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_D_DATA_REG, 0), IDL.FMT_DAT3, MainFrm.Cf4armDBObject.DBO()) + ") ");
      QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
      if (!QV.EOF()) QV.MoveNext();
      if (!QV.EOF())
      {
        v_CENTRO = QV.Get("CENTRICENTRO", IDVariant.STRING) ;
      }
      QV.Close();
      if (IDL.IsNull(v_RILEVANTEECO) && IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_FATTORE, 0)))
      {
        if (!(IDL.IsNull(v_FATTORVALIDO)))
        {
          IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_FATTORE, 0, new IDVariant(v_FATTORVALIDO));
        }
        else
        {
          // 
          // valorizzo fat
          // 
          v_FATTORVALIDO = MainFrm.Getfattoreassociatoeconomica(IMDB.Value(IMDBDef7.TBL_DATISESSIONE, IMDBDef7.FLD_DATISESSIONE_SESSIOESERCI, 0), (new IDVariant("S")), IMDB.Value(IMDBDef5.TBL_VALORICAP7, IMDBDef5.FLD_VALORICAP7_NOMOGGLIV4CA, 0), new IDVariant(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_COD_LIVELLO_5, 0),IDVariant.INTEGER));
          if (!(IDL.IsNull(v_FATTORVALIDO)))
          {
            IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_FATTORE, 0, new IDVariant(v_FATTORVALIDO));
          }
        }
      }
      if (IDL.IsNull(v_RILEVANTEECO) && IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_CENTRO, 0)) && !(IDL.IsNull(v_CENTRO)))
      {
        IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_CENTRO, 0, new IDVariant(v_CENTRO));
      }
      if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_COMPETENZA_DAL, 0)) && !(IDL.IsNull(v_COMPDAL)))
      {
        IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_COMPETENZA_DAL, 0, new IDVariant(v_COMPDAL));
      }
      if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_COMPETENZA_AL, 0)) && !(IDL.IsNull(v_COMPAL)))
      {
        IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_COMPETENZA_AL, 0, new IDVariant(v_COMPAL));
      }
      if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_IMPORTO, 0)))
      {
        if (!(IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0))))
        {
          IMDB.set_Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_IMPORTO, 0, IDL.Sub(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0), IDL.NullValue(PAN_ECONOMICA.GetFieldSum(PFL_ECONOMICA_IMPORTO2),(new IDVariant(0)))));
        }
      }
      return 0;
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "PropostaSuNuovaRiga", _e);
      return -1;
    }
  }

