  // **********************************************************************
  // Ricalcolo Importo IVA
  // **********************************************************************
  public int RicalcoloImportoIVA ()
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;

    try
    {
      TransCount = 0;
      // 
      // Ricalcolo Importo IVA Body
      // Corpo Procedura
      // 
      if (IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0)))
      {
        IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO_IVA, 0, (new IDVariant()));
      }
      else
      {
        IDVariant v_VFATTRATTIVA = new IDVariant(0,IDVariant.STRING);
        SQL = new StringBuffer();
        SQL.append("select ");
        SQL.append("  A.TRATTAMENTO_IVA as FATTRATTAIVA ");
        SQL.append("from ");
        SQL.append("  FAT A ");
        SQL.append("where (A.ANNO_PROG = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FAT_ANNO_PROG, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        SQL.append("and   (A.NUMERO_PROG = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FAT_NUMERO_PROG, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
        if (!QV.EOF()) QV.MoveNext();
        if (!QV.EOF())
        {
          v_VFATTRATTIVA = QV.Get("FATTRATTAIVA", IDVariant.STRING) ;
        }
        QV.Close();
        if (v_VFATTRATTIVA.equals((new IDVariant("SP")), true) || v_VFATTRATTIVA.equals((new IDVariant("RC")), true))
        {
          IDVariant v_VCALCIMPOIVA = new IDVariant(0,IDVariant.DECIMAL);
          v_VCALCIMPOIVA = (new IDVariant());
          SQL = new StringBuffer();
          SQL.append("select ");
          SQL.append("  CALCOLA_IMPORTO_IVA(" + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FAT_ANNO_PROG, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + "," + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_FAT_NUMERO_PROG, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + "," + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") as CIILFAPLLLFN ");
          SQL.append("from ");
          SQL.append("  DUAL A ");
          QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
          if (!QV.EOF()) QV.MoveNext();
          if (!QV.EOF())
          {
            v_VCALCIMPOIVA = QV.Get("CIILFAPLLLFN", IDVariant.DECIMAL) ;
          }
          QV.Close();
          IMDB.set_Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO_IVA, 0, IDL.NullValue(v_VCALCIMPOIVA,IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO_IVA, 0)));
        }
      }
      return 0;
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "RicalcoloImportoIVA", _e);
      return -1;
    }
  }

