  // **********************************************************************
  // Visibilita Schede Inventario
  // **********************************************************************
  public int VisibilitaSchedeInventario ()
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;

    try
    {
      TransCount = 0;
      // 
      // Visibilita Schede Inventario Body
      // Procedure Body
      // 
      // 
      // Il tab Schede Inventario  visibile solo se Gestione
      // Cespiti = 3, passaggio ci4 = SI e non  visibile il
      // folder dell'economica
      // 
      SCHEINVEVISI = (new IDVariant(0));
      if (MainFrm.GESTIOCESPIT.equals((new IDVariant(3)), true) && MainFrm.PASSAGGIOCI4.equals((new IDVariant("SI")), true) && !(ECONOMVISIBI.booleanValue()))
      {
        IDVariant v_VESISSCHEINV = new IDVariant(0,IDVariant.INTEGER);
        if (!(IDL.IsNull(IMDB.Value(IMDBDef5.TBL_PARAMETRI136, IMDBDef5.FLD_PARAMETRI136_PARAMANNOLIQ, 0))) && !(IDL.IsNull(IMDB.Value(IMDBDef5.TBL_PARAMETRI136, IMDBDef5.FLD_PARAMETRI136_PARAMNUMELIQ, 0))))
        {
          SQL = new StringBuffer();
          SQL.append("select ");
          SQL.append("  COUNT(*) as COUNT1 ");
          SQL.append("from ");
          SQL.append("  SCHEDE_INVENTARIO_LIQ A ");
          SQL.append("where (A.NUMERO_LIQ = " + IDL.CSql(IMDB.Value(IMDBDef5.TBL_PARAMETRI136, IMDBDef5.FLD_PARAMETRI136_PARAMNUMELIQ, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
          SQL.append("and   (A.ANNO_LIQ = " + IDL.CSql(IMDB.Value(IMDBDef5.TBL_PARAMETRI136, IMDBDef5.FLD_PARAMETRI136_PARAMANNOLIQ, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
          QV = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
          if (!QV.EOF()) QV.MoveNext();
          if (!QV.EOF())
          {
            v_VESISSCHEINV = QV.Get("COUNT1", IDVariant.INTEGER) ;
          }
          QV.Close();
        }
        if (MainFrm.GESTIOECONOM.compareTo((new IDVariant(-1)), true)!=0)
        {
          PAN_SCHEDEINVENT.set_Visible(((v_VESISSCHEINV.compareTo((new IDVariant(0)), true)>0)?(new IDVariant(-1)).booleanValue():(new IDVariant(0)).booleanValue()));
          SCHEINVEVISI = ((v_VESISSCHEINV.compareTo((new IDVariant(0)), true)>0)?(new IDVariant(-1)):(new IDVariant(0)));
        }
        else
        {
          PAN_SCHEDEINVENT.set_Visible((new IDVariant(-1)).booleanValue());
          SCHEINVEVISI = (new IDVariant(-1));
        }
      }
      else
      {
        PAN_SCHEDEINVENT.set_Visible((new IDVariant(0)).booleanValue());
        SCHEINVEVISI = (new IDVariant(0));
      }
      if (PAN_SCHEDEINVENT.Visible)
      {
        PAN_SCHEDEINVENT.SetFlags (Glb.OBJ_PANEL, 0, ((new IDVariant(0)).booleanValue())? Glb.PAN_FREEWHENHID : 0, Glb.PAN_FREEWHENHID); 
      }
      else
      {
        if (SCHEINVEMODI.booleanValue())
        {
          PAN_SCHEDEINVENT.PanelCommand(Glb.PCM_CANCEL);
          RiempiImdbSchedeInv((new IDVariant(-1)), (new IDVariant(0)));
        }
        PAN_SCHEDEINVENT.SetFlags (Glb.OBJ_PANEL, 0, ((new IDVariant(-1)).booleanValue())? Glb.PAN_FREEWHENHID : 0, Glb.PAN_FREEWHENHID); 
      }
      return 0;
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "VisibilitaSchedeInventario", _e);
      return -1;
    }
  }

