  // **********************************************************************
  // Elimina Da Mandato
  // **********************************************************************
  public int EliminaDaMandato ()
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;
    IDVariant v_LIQUNICA = new IDVariant(0,IDVariant.INTEGER);

    try
    {
      TransCount = 0;
      // 
      // Elimina Da Mandato Body
      // Procedure Body
      // 
      if (!(IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_MAND, 0))) && !(IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_MAND, 0))))
      {
        IDVariant v_AVVISO1 = new IDVariant(0,IDVariant.STRING);
        v_AVVISO1 = (new IDVariant("Mandato gi trasmesso al tesoriere. ", IDVariant.STRING));
        IDVariant v_AVVISO2 = new IDVariant(0,IDVariant.STRING);
        v_AVVISO2 = (new IDVariant("Mandato in distinta.", IDVariant.STRING));
        IDVariant v_AVVISO3 = new IDVariant(0,IDVariant.STRING);
        v_AVVISO3 = (new IDVariant(" Si conferma l'eliminazione?", IDVariant.STRING));
        IDVariant v_MESSAGGIO = new IDVariant(0,IDVariant.STRING);
        IDVariant v_AVVISO4 = new IDVariant(0,IDVariant.STRING);
        v_AVVISO4 = (new IDVariant("Liquidazione sgangiata dal Mandato"));
        v_LIQUNICA = ControlloLiquidazioneUnica();
        if (v_LIQUNICA.equals((new IDVariant(-1)), true))
        {
          return 0;
        }
        if (v_LIQUNICA.equals((new IDVariant(1)), true))
        {
          IDVariant v_AVVISO = new IDVariant(0,IDVariant.STRING);
          v_AVVISO = (new IDVariant("Unica Liquidazione presente sul mandato: non eliminabile singolarmente. Eseguire eliminazione del mandato.", IDVariant.STRING));
          MainFrm.set_AlertMessage(v_AVVISO); 
          return 0;
        }
        v_MESSAGGIO = (new IDVariant());
        if (MainFrm.FunzioneLicenza(IMDB.Value(IMDBDef7.TBL_DATISESSIONE, IMDBDef7.FLD_DATISESSIONE_SESSIOISTANZ, 0), (new IDVariant("MIF"))))
        {
          if (ControlloMandatoTrasmesso().equals((new IDVariant(1)), true))
          {
            v_MESSAGGIO = new IDVariant(v_AVVISO1);
          }
        }
        if (ControlloMandatoInDistinta().equals((new IDVariant(1)), true))
        {
          v_MESSAGGIO = IDL.Add(v_MESSAGGIO, v_AVVISO2);
        }
        if (!(IDL.IsNull(v_MESSAGGIO)))
        {
          if (!(MainFrm.MessageConfirm(IDL.Add(v_MESSAGGIO, v_AVVISO3))))
          {
            return 0;
          }
        }
        try
        {
          SQL = new StringBuffer();
          SQL.append("update LIQ set ");
          SQL.append("  ANNO_MAND = to_number(NULL), ");
          SQL.append("  NUMERO_MAND = to_number(NULL) ");
          SQL.append("where (ANNO_LIQ = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_LIQ, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
          SQL.append("and   (NUMERO_LIQ = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_LIQ, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
          MainFrm.Cf4armDBObject.DBO().Execute(SQL);
        }
        catch (Exception e14)
        {
          MainFrm.set_AlertMessage(new IDVariant(e14.getMessage())); 
        }
        MainFrm.set_AlertMessage(v_AVVISO4); 
      }
      return 0;
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "EliminaDaMandato", _e);
      return -1;
    }
  }

  // **********************************************************************
  // Elimina Economica
  // **********************************************************************
  public int EliminaEconomica ()
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;
    IDVariant v_AVVISO = new IDVariant(0,IDVariant.STRING);
    IDVariant v_MODIFIECONOM = new IDVariant(0,IDVariant.INTEGER);

    try
    {
      TransCount = 0;
      v_AVVISO = (new IDVariant("Confermi la cancellazione?", IDVariant.STRING));
      // 
      // Elimina Economica Body
      // Procedure Body
      // 
      if (MainFrm.MessageConfirm(v_AVVISO))
      {
        if (IDL.Sub(IDL.NullValue(PAN_ECONOMICA.GetFieldSum(PFL_ECONOMICA_IMPORTO2),(new IDVariant(0))), IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_IMPORTO, 0)).compareTo(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0), true)!=0)
        {
          IDVariant v_AVVISO1 = new IDVariant(0,IDVariant.STRING);
          v_AVVISO1 = (new IDVariant("Totale imputazione Economiche diverso dall'importo della Liquidazione!", IDVariant.STRING));
          MainFrm.set_AlertMessage(v_AVVISO1); 
          return 0;
        }
        if ((new IDVariant(PAN_ECONOMICA.Status()).equals((new IDVariant(3)), true)) || ECONOMMODIFI.booleanValue())
        {
          v_MODIFIECONOM = (new IDVariant(-1));
        }
        try
        {
          // 
          // 30/07/2018 EG : modifica effettuata per gestire il
          // caso in cui si cancella una riga delle imputazioni
          // economiche
          // mantenendo il totale di liquidazione e la procedure
          // salva liquidazione genera un errore di db non bloccante
          // 
          // Nella versione precedente il messaggio sul totale imputazione
          // economica veniva mostrato dopo il salvataggio anche
          // se il totale era corretto
          // 
          if (v_MODIFIECONOM.booleanValue())
          {
            IDVariant v_VOLDSTATO = null;
            v_VOLDSTATO = IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_IMPECOSTATO, 0);
            ELIMINECONOM_IMPECOUPDAT1();
            if (!(Salva()))
            {
              ELIMINECONOM_IMPECOUPDATE(v_VOLDSTATO);
            }
            else
            {
              SQL = new StringBuffer();
              SQL.append("delete from IMP_ECO ");
              SQL.append("where (PROGRESSIVO = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_PROGRESSIVO, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
              MainFrm.Cf4armDBObject.DBO().Execute(SQL);
              PAN_ECONOMICA.PanelCommand(Glb.PCM_DELETE);
            }
          }
          else
          {
            SQL = new StringBuffer();
            SQL.append("delete from IMP_ECO ");
            SQL.append("where (PROGRESSIVO = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_PROGRESSIVO, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
            MainFrm.Cf4armDBObject.DBO().Execute(SQL);
            PAN_ECONOMICA.PanelCommand(Glb.PCM_DELETE);
          }
          // SQL = new StringBuffer();
          // SQL.append("delete from IMP_ECO ");
          // SQL.append("where (PROGRESSIVO = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_PROGRESSIVO, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
          // MainFrm.Cf4armDBObject.DBO().Execute(SQL);
          // PAN_ECONOMICA.PanelCommand(Glb.PCM_DELETE);
          // if (v_MODIFIECONOM.booleanValue())
          // {
            // Salva();
          // }
        }
        catch (Exception e12)
        {
          MainFrm.set_AlertMessage(new IDVariant(e12.getMessage())); 
          if (v_MODIFIECONOM.booleanValue())
          {
            PAN_ECONOMICA.SetModified(MainFrm);
          }
          return 0;
        }
      }
      return 0;
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "EliminaEconomica", _e);
      return -1;
    }
  }

  // **********************************************************************
  // IMP ECO: Update
  // Perch stai aggiornando questi dati?
  // **********************************************************************
  private void ELIMINECONOM_IMPECOUPDAT1() throws SQLException
  {
    IMDB.TblMoveFirst(IMDBDef5.TBL_IMPECO, 0);
    while (!IMDB.Eof(IMDBDef5.TBL_IMPECO, 0))
    {
      if (IMDB.Value(IMDBDef5.TBL_IMPECO, IMDBDef5.FLD_IMPECO_PROGRESSIVO, 0).equals(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_PROGRESSIVO, 0), true))
      {
      IMDB.set_Value(IMDBDef5.TBL_IMPECO, IMDBDef5.FLD_IMPECO_IMPECOSTATO, 0, (new IDVariant("D")));
      }
      IMDB.TblMoveNext(IMDBDef5.TBL_IMPECO, 0);
    }
    IMDB.TblMoveFirst(IMDBDef5.TBL_IMPECO, 0);
  }

  // **********************************************************************
  // IMP ECO: Update
  // Perch stai aggiornando questi dati?
  // **********************************************************************
  private void ELIMINECONOM_IMPECOUPDATE(IDVariant v_VOLDSTATO) throws SQLException
  {
    IMDB.TblMoveFirst(IMDBDef5.TBL_IMPECO, 0);
    while (!IMDB.Eof(IMDBDef5.TBL_IMPECO, 0))
    {
      if (IMDB.Value(IMDBDef5.TBL_IMPECO, IMDBDef5.FLD_IMPECO_PROGRESSIVO, 0).equals(IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_PROGRESSIVO, 0), true))
      {
      IMDB.set_Value(IMDBDef5.TBL_IMPECO, IMDBDef5.FLD_IMPECO_IMPECOSTATO, 0, v_VOLDSTATO);
      }
      IMDB.TblMoveNext(IMDBDef5.TBL_IMPECO, 0);
    }
    IMDB.TblMoveFirst(IMDBDef5.TBL_IMPECO, 0);
  }

