  // **********************************************************************
  // Riempi IMDB Eco
  // Spiega quale elaborazione viene eseguita da questa
  // procedura
  // riempire - Input
  // **********************************************************************
  public int RiempiIMDBEco (IDVariant riempire)
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;
    IDCachedRowSet C3;

    try
    {
      TransCount = 0;
      // 
      // Riempi IMDB Eco Body
      // Corpo Procedura
      // 
      if (riempire.booleanValue() || IMDB.Value(IMDBDef14.PQRY_IMPECO12, IMDBDef14.PQSL_IMPECO12_NUMERO_LIQ, 0).compareTo(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_LIQ, 0), true)!=0)
      {
        RIEMPIMDBECO_IMPECODELETE();
        SQL = new StringBuffer();
        SQL.append("select ");
        SQL.append("  A.ESERCIZIO as IMPECOESERCI, ");
        SQL.append("  A.PROGRESSIVO as IMPECOPROGRE, ");
        SQL.append("  A.ANNO_PROG as IMPECOANNPRO, ");
        SQL.append("  A.NUMERO_PROG as IMPECONUMPRO, ");
        SQL.append("  A.ANNO_LIQ as IMPECOANNLIQ, ");
        SQL.append("  A.NUMERO_LIQ as IMPECONUMLIQ, ");
        SQL.append("  A.ANNO_PRE as IMPECOANNPRE, ");
        SQL.append("  A.NUMERO_PRE as IMPECONUMPRE, ");
        SQL.append("  A.FATTORE as IMPECOFATTOR, ");
        SQL.append("  A.CENTRO as IMPECOCENTRO, ");
        SQL.append("  A.IMPORTO as IMPECOIMPORT, ");
        SQL.append("  A.COMPETENZA_DAL as IMPECOCOMDAL, ");
        SQL.append("  A.COMPETENZA_AL as IMPECOCOMPAL, ");
        SQL.append("  A.NOTE as IMPECONOTE, ");
        SQL.append("  A.IMPORTO_EURO as IMPECOIMPEUR, ");
        SQL.append("  A.ANNO_ACC as IMPECOANNACC, ");
        SQL.append("  A.NUMERO_ACC as IMPECONUMACC, ");
        SQL.append("  A.ANNO_IMP as IMPECOANNIMP, ");
        SQL.append("  A.NUMERO_IMP as IMPECONUMIMP, ");
        SQL.append("  A.ANNO_SUBIMP as IMPECOANNSUB, ");
        SQL.append("  A.NUMERO_SUBIMP as IMPECONUMSUB, ");
        SQL.append("  A.PROGRESSIVO_VARACC as IMPECOPROVA1, ");
        SQL.append("  A.PROGRESSIVO_VARIMP as IMPECOPROVA2, ");
        SQL.append("  A.PROGRESSIVO_VARSUB as IMPECOPROVAR, ");
        SQL.append("  A.NO_IVA as IMPECONOIVA, ");
        SQL.append("  A.PROGETTO_ID as IMPECOPROGID, ");
        SQL.append("  A.IVA as IMPECOIVA, ");
        SQL.append("  A.CAMPO_LIBERO_1 as IMPECOCAMLI1, ");
        SQL.append("  A.CAMPO_LIBERO_2 as IMPECOCAMLI2, ");
        SQL.append("  A.PROGR_SCHEDA_CIWEB as IMPECOPRSCCI ");
        SQL.append("from ");
        SQL.append("  IMP_ECO A ");
        SQL.append("where (A.NUMERO_LIQ = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_LIQ, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        SQL.append("and   (A.ANNO_LIQ = " + IDL.CSql(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_LIQ, 0), IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
        SQL.append("order by ");
        SQL.append("  A.PROGRESSIVO ");
        C3 = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
        if (!C3.EOF()) C3.MoveNext();
        while (!C3.EOF())
        {
          RIEMPIMDBECO_IMPECOINSINT(C3.Get("IMPECOESERCI"), C3.Get("IMPECOPROGRE"), C3.Get("IMPECOANNPRO"), C3.Get("IMPECONUMPRO"), C3.Get("IMPECOANNLIQ"), C3.Get("IMPECONUMLIQ"), C3.Get("IMPECOANNPRE"), C3.Get("IMPECONUMPRE"), C3.Get("IMPECOFATTOR"), C3.Get("IMPECOCENTRO"), C3.Get("IMPECOIMPORT"), C3.Get("IMPECOCOMDAL"), C3.Get("IMPECOCOMPAL"), C3.Get("IMPECONOTE"), C3.Get("IMPECOIMPEUR"), C3.Get("IMPECOANNACC"), C3.Get("IMPECONUMACC"), C3.Get("IMPECOANNIMP"), C3.Get("IMPECONUMIMP"), C3.Get("IMPECOANNSUB"), C3.Get("IMPECONUMSUB"), C3.Get("IMPECOPROVA1"), C3.Get("IMPECOPROVA2"), C3.Get("IMPECOPROVAR"), C3.Get("IMPECONOIVA"), C3.Get("IMPECOPROGID"), C3.Get("IMPECOIVA"), C3.Get("IMPECOCAMLI1"), C3.Get("IMPECOCAMLI2"), C3.Get("IMPECOPRSCCI"));
          C3.MoveNext();
        }
        C3.Close();
        ECONOMMODIFI = (new IDVariant(0));
      }
      return 0;
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "RiempiIMDBEco", _e);
      return -1;
    }
  }

