  // **********************************************************************
  // Imdb Schede Inventario Liq: Insert into... select
  // Perch stai inserendo questi dati?
  // **********************************************************************
  private void RIEIMDSCHINV_IMSCINLIINIS(IDVariant v_VANNOLIQ, IDVariant v_VNUMEROLIQ) throws SQLException
  {
    StringBuffer SQL = new StringBuffer();
    IDCachedRowSet RS = new IDCachedRowSet();

    SQL = new StringBuffer();
    SQL.append("select ");
    SQL.append("  A.PROGRESSIVO as SCHINVLIQPRO, ");
    SQL.append("  A.ANNO_LIQ as SCHINVANNLIQ, ");
    SQL.append("  A.NUMERO_LIQ as SCHINVNUMLIQ, ");
    SQL.append("  A.ANNO_PROG_FAT as SCINLIANPRFA, ");
    SQL.append("  A.NUMERO_PROG_FAT as SCINLINUPRFA, ");
    SQL.append("  A.IMPORTO as SCHINVLIQIMP, ");
    SQL.append("  A.PROGR_SCHEDA_CIWEB as SCINLIPRSCCI, ");
    SQL.append("  A.PROGRESSIVO_BOAC as SCHINVLIPRBO, ");
    SQL.append("  A.NOTE as SCHINVLIQNOT, ");
    SQL.append("  NULL as C ");
    SQL.append("from ");
    SQL.append("  SCHEDE_INVENTARIO_LIQ A ");
    SQL.append("where (A.ANNO_LIQ = " + IDL.CSql(v_VANNOLIQ, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
    SQL.append("and   (A.NUMERO_LIQ = " + IDL.CSql(v_VNUMEROLIQ, IDL.FMT_NUM, MainFrm.Cf4armDBObject.DBO()) + ") ");
    SQL.append("order by ");
    SQL.append("  A.PROGRESSIVO ");
    RS = MainFrm.Cf4armDBObject.DBO().OpenRS(SQL);
    if (!RS.EOF()) RS.MoveNext();
    while (!RS.EOF())
    {
      IMDB.TblAddNew(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ, 0);
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_PROGRESSIVO,0,RS.Get(1));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_ANNO_LIQ,0,RS.Get(2));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_NUMERO_LIQ,0,RS.Get(3));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_ANNO_PROG_FAT,0,RS.Get(4));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_NUMERO_PROG_FAT,0,RS.Get(5));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_IMPORTO,0,RS.Get(6));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_PROGR_SCHEDA_CIWEB,0,RS.Get(7));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_PROGRESSIVO_BOAC,0,RS.Get(8));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_NOTE,0,RS.Get(9));
      IMDB.set_Value(IMDBDef5.TBL_SCHEDE_INVENTARIO_LIQ,IMDBDef5.FLD_SCHEDE_INVENTARIO_LIQ_SCHINVLIQSTA,0,RS.Get(10));
      RS.MoveNext();
    }
  }

  // **********************************************************************
  // Salva
  // **********************************************************************
  public boolean Salva ()
  {
    StringBuffer SQL = new StringBuffer();
    int TransCount   = 0;
    int ReturnStatus = 0;
    IDCachedRowSet QV;
    IDVariant v_AVVISO = new IDVariant(0,IDVariant.STRING);
    IDVariant v_LIQUIDAZIONI = new IDVariant(0,IDVariant.INTEGER);

    try
    {
      TransCount = 0;
      // 
      // Salva Body
      // Procedure Body
      // 
      if ((new IDVariant(PAN_LIQUIDAZIONE.Status()).equals((new IDVariant(3)), true)) || (PAN_ECONOMICA.Visible && ECONOMMODIFI.booleanValue()) || (PAN_SCHEDEINVENT.Visible && SCHEINVEMODI.booleanValue()))
      {
        if (ECONOMVISIBI.booleanValue())
        {
          if (PAN_ECONOMICA.IsPanelInError())
          {
            PAN_ECONOMICA.PanelCommand(Glb.PCM_UPDATE);
            return (new IDVariant(0)).booleanValue();
          }
        }
        if (PAN_SCHEDEINVENT.Visible)
        {
          if (PAN_SCHEDEINVENT.IsPanelInError())
          {
            PAN_SCHEDEINVENT.PanelCommand(Glb.PCM_UPDATE);
            return (new IDVariant(0)).booleanValue();
          }
        }
        if (new IDVariant(PAN_LIQUIDAZIONE.Status()).equals((new IDVariant(3)), true))
        {
          v_AVVISO = (new IDVariant());
          if (ControlliBloccanti(v_AVVISO).equals((new IDVariant(-1)), true))
          {
            return (new IDVariant(0)).booleanValue();
          }
          v_AVVISO = IDL.Add(v_AVVISO, ControlliNonBloccanti());
          if (!(IDL.IsNull(v_AVVISO)))
          {
            if (!(MainFrm.MessageConfirm(IDL.Add(v_AVVISO, (new IDVariant("<BR/>Si desidera proseguire?"))))))
            {
              return (new IDVariant(0)).booleanValue();
            }
          }
        }
        else
        {
          if (ECONOMVISIBI.booleanValue())
          {
            IDVariant v_VSUMIMPECONO = new IDVariant(0,IDVariant.DECIMAL);
            SALVA_CFASELINTV14();
            if (!IMDB.Eof(IMDBDef14.QRY_CFASELINTV14, 0))
            {
              v_VSUMIMPECONO = IMDB.Value(IMDBDef14.QRY_CFASELINTV14, IMDBDef14.QSL_CFASELINTV14_SUNUVAIMECI0, 0, IDVariant.DECIMAL) ;
            }
            if (v_VSUMIMPECONO.compareTo(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0), true)!=0)
            {
              IDVariant v_AVVISO1 = new IDVariant(0,IDVariant.STRING);
              v_AVVISO1 = (new IDVariant("Totale imputazione Economiche diverso dall'importo della Liquidazione!"));
              MainFrm.set_AlertMessage(v_AVVISO1); 
              return (new IDVariant(0)).booleanValue();
            }
            // if (PAN_ECONOMICA.GetFieldSum(PFL_ECONOMICA_IMPORTO2).compareTo(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0), true)!=0)
            // {
              // MainFrm.set_AlertMessage(v_AVVISO1); 
              // return (new IDVariant(0)).booleanValue();
            // }
            if (!(SalvaIMPEco()))
            {
              return (new IDVariant(0)).booleanValue();
            }
          }
          if (SCHEINVEVISI.booleanValue())
          {
            IDVariant v_VSUMIMPSCHIN = new IDVariant(0,IDVariant.DECIMAL);
            SALVA_CFASELINTV13();
            if (!IMDB.Eof(IMDBDef14.QRY_CFASELINTV13, 0))
            {
              v_VSUMIMPSCHIN = IMDB.Value(IMDBDef14.QRY_CFASELINTV13, IMDBDef14.QSL_CFASELINTV13_SUNUVASCILI0, 0, IDVariant.DECIMAL) ;
            }
            if (v_VSUMIMPSCHIN.compareTo(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0), true)!=0)
            {
              IDVariant v_VAVVISO = new IDVariant(0,IDVariant.STRING);
              v_VAVVISO = (new IDVariant("Totale Schede Inventario diverso dal totale della Liquidazione!"));
              MainFrm.set_AlertMessage(v_VAVVISO); 
              return (new IDVariant(0)).booleanValue();
            }
            if (!(SalvaSchedeInv()))
            {
              return (new IDVariant(0)).booleanValue();
            }
          }
        }
        MainFrm.Cf4armDBObject.BeginTrans();
        if (PAN_LIQUIDAZIONE.IsNewRow())
        {
          NUMEROLIQ = (new IDVariant());
          MainFrm.Cf4armDBObject.ACHKNUMERAZIONE(IMDB.Value(IMDBDef7.TBL_DATISESSIONE, IMDBDef7.FLD_DATISESSIONE_SESSIOESERCI, 0), (new IDVariant("liq")), NUMEROLIQ);
        }
        if (new IDVariant(PAN_LIQUIDAZIONE.Status()).equals((new IDVariant(3)), true))
        {
          v_LIQUIDAZIONI = (new IDVariant(-1));
          PAN_LIQUIDAZIONE.PanelCommand(Glb.PCM_UPDATE);
        }
        if (new IDVariant(PAN_LIQUIDAZIONE.Status()).compareTo((new IDVariant(3)), true)!=0)
        {
          // 
          // controllo bloccante non bloccante cassa
          // 
          {
            MainFrm.Cf4armDBObject.set_ErrorMessage((new IDVariant("")).stringValue());
            MainFrm.Cf4armDBObject.CONTROLLODISPCASSAVPRO(IMDB.Value(IMDBDef7.TBL_DATISESSIONE, IMDBDef7.FLD_DATISESSIONE_SESSIOESERCI, 0), IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_CAPITOLO, 0), IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ARTICOLO, 0), ((IDL.IsNull(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_MAND, 0)))?(new IDVariant("LI")):(new IDVariant("EM"))));
            if ((new IDVariant(MainFrm.Cf4armDBObject.ErrorMessage())).compareTo((new IDVariant("")), true)!=0)
            {
              IDVariant v_ERRORE = new IDVariant(0,IDVariant.STRING);
              v_ERRORE = IDL.SubStr((new IDVariant(MainFrm.Cf4armDBObject.ErrorMessage())), (new IDVariant(5)), (new IDVariant(5)));
              if (v_ERRORE.equals((new IDVariant("20999")), true))
              {
                MainFrm.set_AlertMessage((new IDVariant(MainFrm.Cf4armDBObject.ErrorMessage()))); 
                MainFrm.Cf4armDBObject.RollbackTrans();
                if (v_LIQUIDAZIONI.booleanValue())
                {
                  PanelRollback();
                  PAN_LIQUIDAZIONE.SetModified(MainFrm);
                }
                if (ECONOMMODIFI.booleanValue())
                {
                  PAN_ECONOMICA.SetModified(MainFrm);
                }
                return (new IDVariant(0)).booleanValue();
              }
              else if (v_ERRORE.equals((new IDVariant("20998")), true))
              {
                IDVariant B = null;
                B = (new IDVariant(MainFrm.MessageConfirmEx(MainFrm.AFC.GetErrorDB((new IDVariant(MainFrm.Cf4armDBObject.ErrorMessage()))))));
                if (IDL.IsNull(B))
                {
                  MainFrm.Cf4armDBObject.RollbackTrans();
                  if (v_LIQUIDAZIONI.booleanValue())
                  {
                    PanelRollback();
                    PAN_LIQUIDAZIONE.SetModified(MainFrm);
                  }
                  if (ECONOMMODIFI.booleanValue())
                  {
                    PAN_ECONOMICA.SetModified(MainFrm);
                  }
                  if (SCHEINVEMODI.booleanValue())
                  {
                    PAN_SCHEDEINVENT.SetModified(MainFrm);
                  }
                  return (new IDVariant(0)).booleanValue();
                }
                else if (!(B.equals((new IDVariant(-1)), true)))
                {
                  MainFrm.Cf4armDBObject.RollbackTrans();
                  if (v_LIQUIDAZIONI.booleanValue())
                  {
                    PanelRollback();
                    PAN_LIQUIDAZIONE.SetModified(MainFrm);
                  }
                  if (ECONOMVISIBI.booleanValue())
                  {
                    if (ECONOMMODIFI.booleanValue())
                    {
                      PAN_ECONOMICA.SetModified(MainFrm);
                    }
                  }
                  if (SCHEINVEVISI.booleanValue())
                  {
                    if (SCHEINVEMODI.booleanValue())
                    {
                      PAN_SCHEDEINVENT.SetModified(MainFrm);
                    }
                  }
                  return (new IDVariant(0)).booleanValue();
                }
                else
                {
                  MainFrm.DTTObj.Add(IDL.ToString(IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_IMPORTO, 0)).stringValue(), (new IDVariant(999)).intValue(), (new IDVariant(2)).intValue()); 
                }
              }
            }
          }
          if (ECONOMVISIBI.booleanValue())
          {
            if (ECONOMMODIFI.booleanValue())
            {
              if (!(SalvaIMPEco()))
              {
                MainFrm.Cf4armDBObject.RollbackTrans();
                if (v_LIQUIDAZIONI.booleanValue())
                {
                  PanelRollback();
                }
                return (new IDVariant(0)).booleanValue();
              }
              // PAN_ECONOMICA.PanelCommand(Glb.PCM_UPDATE);
            }
            // if (new IDVariant(PAN_ECONOMICA.Status()).equals((new IDVariant(3)), true))
            // {
              // MainFrm.Cf4armDBObject.RollbackTrans();
              // if (v_LIQUIDAZIONI.booleanValue())
              // {
                // PanelRollback();
              // }
            // }
          }
          if (SCHEINVEVISI.booleanValue())
          {
            if (SCHEINVEMODI.booleanValue())
            {
              if (!(SalvaSchedeInv()))
              {
                MainFrm.Cf4armDBObject.RollbackTrans();
                if (v_LIQUIDAZIONI.booleanValue())
                {
                  PanelRollback();
                }
                return (new IDVariant(0)).booleanValue();
              }
            }
          }
        }
        else
        {
          MainFrm.Cf4armDBObject.RollbackTrans();
          return (new IDVariant(0)).booleanValue();
        }
        MainFrm.Cf4armDBObject.CommitTrans();
        IMDB.set_Value(IMDBDef5.TBL_PARAMETRI136, IMDBDef5.FLD_PARAMETRI136_PARAMANNOLIQ, 0, IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_ANNO_LIQ, 0));
        IMDB.set_Value(IMDBDef5.TBL_PARAMETRI136, IMDBDef5.FLD_PARAMETRI136_PARAMNUMELIQ, 0, IMDB.Value(IMDBDef14.PQRY_LIQ19, IMDBDef14.PQSL_LIQ19_NUMERO_LIQ, 0));
        SettaCaption();
        PAN_LIQUIDAZIONE.PanelCommand(Glb.PCM_REQUERY);
        PAN_LIQUIDAZIONE.set_ActualPosition(true, (new IDVariant(1)).intValue());
        return (new IDVariant(-1)).booleanValue();
      }
      return (new IDVariant(0)).booleanValue();
    }
    catch (Exception _e)
    {
      MainFrm.ErrObj.ProcError ("Liquidazione", "Salva", _e);
      return false;
    }
  }

  // **********************************************************************
  // Cfaid: Select into variables
  // Quali dati devi selezionare con questa query?
  // **********************************************************************
  private void SALVA_CFASELINTV14() throws SQLException
  {
    IDVariant[] AggrBuff;
    int[] AggrRowCount;
    int AggrCount=0;
    boolean AggrNewGroup = false;

    IMDB.TblTruncate(IMDBDef14.QRY_CFASELINTV14);
    IMDB.TblTruncate(IMDBDef1.TMP_RECORDSET);
    IMDB.TblMoveFirst(IMDBDef5.TBL_IMPECO, 0);
    Loop1: while (!IMDB.Eof(IMDBDef5.TBL_IMPECO, 0))
    {
      if (IDL.NullValue(IMDB.Value(IMDBDef5.TBL_IMPECO, IMDBDef5.FLD_IMPECO_IMPECOSTATO, 0),(new IDVariant("I"))).compareTo((new IDVariant("D")), true)!=0)
      {
        IMDB.TblAddNew(IMDBDef1.TMP_RECORDSET, 0);
        IMDB.set_Value(IMDBDef1.TMP_RECORDSET, 0, 0, IDL.NullValue(IMDB.Value(IMDBDef5.TBL_IMPECO, IMDBDef5.FLD_IMPECO_IMPORTO, 0),(new IDVariant(0))));
      }
      IMDB.TblMoveNext(IMDBDef5.TBL_IMPECO, 0);
      if (IMDB.Eof(IMDBDef5.TBL_IMPECO, 0))
      {
        IMDB.TblMoveFirst(IMDBDef5.TBL_IMPECO, 0);
      }
      else
      {
        continue Loop1;
      }
      break;
    }
    IMDB.TblMoveFirst(IMDBDef1.TMP_RECORDSET, 0);
    AggrBuff = new IDVariant[1];
    for (int i=0; i<AggrBuff.length; i++) AggrBuff[i] = new IDVariant();
    AggrRowCount = new int[1];
    AggrCount = 0;
    IMDB.TblMoveFirst(IMDBDef1.TMP_RECORDSET, 0);
    if (IMDB.TblNumRows(IMDBDef1.TMP_RECORDSET) > 0)
    {
      while (true)
      {
        if (AggrCount == 0 && !IMDB.Eof(IMDBDef1.TMP_RECORDSET, 0))
        {
          AggrBuff[0] = IMDB.Value(IMDBDef1.TMP_RECORDSET, 0, 0);
          if (!IDL.IsNull(IMDB.Value(IMDBDef1.TMP_RECORDSET, 0, 0))) AggrRowCount[0] = 1; else AggrRowCount[0] = 0;
          AggrCount = 1;
          IMDB.TblMoveNext(IMDBDef1.TMP_RECORDSET, 0);
        }
        else
        {
          AggrNewGroup = IMDB.Eof(IMDBDef1.TMP_RECORDSET, 0);
          if (AggrNewGroup)
          {
            if (AggrCount > 0)
            {
              IMDB.TblAddNew(IMDBDef14.QRY_CFASELINTV14, 0);
              IMDB.set_Value(IMDBDef14.QRY_CFASELINTV14, 0, 0, AggrBuff[0]);
            }
            AggrCount = 0;
            if (IMDB.Eof(IMDBDef1.TMP_RECORDSET, 0)) break;
          }
          else
          {
            if (!IMDB.Eof(IMDBDef1.TMP_RECORDSET, 0))
            {
              if (!IDL.IsNull(IMDB.Value(IMDBDef1.TMP_RECORDSET, 0, 0)))
              {
                AggrBuff[0] = IDL.Add(AggrBuff[0], IMDB.Value(IMDBDef1.TMP_RECORDSET, 0, 0));
                AggrRowCount[0]++;
              }
              AggrCount++;
              IMDB.TblMoveNext(IMDBDef1.TMP_RECORDSET, 0);
            }
          }
        }
      }
    }
    IMDB.TblMoveFirst(IMDBDef14.QRY_CFASELINTV14, 0);
  }

