  private void PAN_ECONOMICA_InitQueries()
  {
    StringBuffer SQL;

    PAN_ECONOMICA.SetSize(MyGlb.OBJ_QUERY, 5);
    SQL = new StringBuffer();
    SQL.append("select ");
    SQL.append("  A.DESCRIZIONE as FATTORDESCRI, ");
    SQL.append("  A.TIPO as FATTORITIPO ");
    SQL.append("from ");
    SQL.append("  FATTORI A ");
    SQL.append("where (A.FATTORE = ~~FATTORE~~) ");
    SQL.append("and   ((A.DATA_VALIDITA IS NULL) OR (A.DATA_VALIDITA >= ~~PQRY_LIQ19.D_DATA_REG~~)) ");
    PAN_ECONOMICA.SetQuery(PPQRY_FATTORI, 0, SQL, -1, "");
    PAN_ECONOMICA.SetQueryDB(PPQRY_FATTORI, MainFrm.Cf4armDBObject.DB, 4);
    PAN_ECONOMICA.SetMasterTable(PPQRY_FATTORI, "FATTORI");
    SQL = new StringBuffer();
    SQL.append("select ");
    SQL.append("  A.DESCRIZIONE as CENTRIDESCRI ");
    SQL.append("from ");
    SQL.append("  CENTRI A ");
    SQL.append("where (A.CENTRO = ~~CENTRO~~) ");
    SQL.append("and   ((A.DATA_VALIDITA IS NULL) OR (A.DATA_VALIDITA >= ~~PQRY_LIQ19.D_DATA_REG~~)) ");
    PAN_ECONOMICA.SetQuery(PPQRY_CENTRI, 0, SQL, -1, "");
    PAN_ECONOMICA.SetQueryDB(PPQRY_CENTRI, MainFrm.Cf4armDBObject.DB, 4);
    PAN_ECONOMICA.SetMasterTable(PPQRY_CENTRI, "CENTRI");
    SQL = new StringBuffer();
    SQL.append("select ");
    SQL.append("  A.PROGR_SCHEDA as VISSCHCIPRSC, ");
    SQL.append("  A.DESCRIZIONE_BENE as VISSCHCIDEBE ");
    SQL.append("from ");
    SQL.append("  VISTA_SCHEDE_CIWEB A ");
    SQL.append("where (A.PROGR_SCHEDA = ~~PROGR_SCHEDA_CIWEB~~) ");
    PAN_ECONOMICA.SetQuery(PPQRY_VISTSCHECIW1, 0, SQL, -1, "");
    PAN_ECONOMICA.SetQueryDB(PPQRY_VISTSCHECIW1, MainFrm.Cf4armDBObject.DB, 4);
    PAN_ECONOMICA.SetMasterTable(PPQRY_VISTSCHECIW1, "VISTA_SCHEDE_CIWEB");
    SQL = new StringBuffer();
    SQL.append("select ");
    SQL.append("  DECODE(~~NOTE~~, NULL, 'N', 'P') as APRINOTE ");
    SQL.append("from ");
    SQL.append("  DUAL A ");
    SQL.append("where (NOT ((~~ESERCIZIO~~ IS NULL))) ");
    PAN_ECONOMICA.SetQuery(PPQRY_DUAL, 0, SQL, -1, "");
    PAN_ECONOMICA.SetQueryDB(PPQRY_DUAL, MainFrm.Cf4armDBObject.DB, 4);
    PAN_ECONOMICA.SetMasterTable(PPQRY_DUAL, "DUAL");
    PAN_ECONOMICA.SetIMDB(IMDB, "PQRY_IMPECO12", true);
    PAN_ECONOMICA.set_SetString(MyGlb.MASTER_ROWNAME, "IMP ECO");
    PAN_ECONOMICA.SetQueryIMDB(PPQRY_IMPECO12, IMDBDef14.PQRY_IMPECO12_RS, IMDBDef5.TBL_IMPECO);
    JustLoaded = true;
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_FATTORE1, IMDBDef5.FLD_IMPECO_FATTORE);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_CENTRO1, IMDBDef5.FLD_IMPECO_CENTRO);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_IMPORTO2, IMDBDef5.FLD_IMPECO_IMPORTO);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_COMPETENZDAL, IMDBDef5.FLD_IMPECO_COMPETENZA_DAL);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_COMPETENZAAL, IMDBDef5.FLD_IMPECO_COMPETENZA_AL);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_NOTE2, IMDBDef5.FLD_IMPECO_NOTE);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_PROGSCHECIW1, IMDBDef5.FLD_IMPECO_PROGR_SCHEDA_CIWEB);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_ESERCIZIO, IMDBDef5.FLD_IMPECO_ESERCIZIO);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_ANNOLIQ2, IMDBDef5.FLD_IMPECO_ANNO_LIQ);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_NUMEROLIQ2, IMDBDef5.FLD_IMPECO_NUMERO_LIQ);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_PROGRESSIVO1, IMDBDef5.FLD_IMPECO_PROGRESSIVO);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_STATO1, IMDBDef2.FLD_IMPECO6_IMPECOSTATO);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_CAMPOLIBERO1, IMDBDef5.FLD_IMPECO_CAMPO_LIBERO_1);
    PAN_ECONOMICA.SetFieldPrimaryIndex(PFL_ECONOMICA_CAMPOLIBERO2, IMDBDef5.FLD_IMPECO_CAMPO_LIBERO_2);
    PAN_ECONOMICA.SetMasterTable(0, "IMPECO");
    //
    // Rieseguo la query se il pannello era gi in stato DATA
    if (PAN_ECONOMICA.Status() == 2)
    {
      int oldListQBE = PAN_ECONOMICA.iUseListQBE;
      PAN_ECONOMICA.iUseListQBE = 0;
      PAN_ECONOMICA.PanelCommand(Glb.PCM_SEARCH);
      PAN_ECONOMICA.PanelCommand(Glb.PCM_FIND);
      PAN_ECONOMICA.iUseListQBE = oldListQBE;
    }
  }

